class Solution(object):
    def numberOfAlternatingGroups(self, colors, k):
        """
        :type colors: List[int]
        :type k: int
        :rtype: int
        """
        def repeated_color_index_founder(group):
            for i in range(1, len(group)):
                if group[i] == group[i-1]:
                    return i
            return None
        line_of_combinations = colors + colors[:k-1]
        #print(line_of_combinations)
        number_of_alternating_groups = 0
        skip_to = 0
        was_previous_group_alternating = False
        for index in range(len(colors)):
            #print(f"{index}/{len(colors)}")
            if index >= skip_to:
                group = line_of_combinations[index:index+k]
                if not was_previous_group_alternating:
                    repeated_color_index = repeated_color_index_founder(group)
                    if repeated_color_index:
                        skip_to = index + repeated_color_index
                        was_previous_group_alternating = False
                    else:
                        number_of_alternating_groups += 1
                        was_previous_group_alternating = True
                else:
                    if group[-1] == group[-2]:
                        was_previous_group_alternating = False
                    else:
                        number_of_alternating_groups += 1
                    
            else:
                pass
        return number_of_alternating_groups



